import React from 'react';
import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

function App() {
    return (
      <header>
        <div class="position-logo">
            <img src="lab-assets/logo.png" />
        <div class="delicious-food">
            <p id="delicious">Delicious</p>
            <p id="best-food">THE BEST FOOD BLOG ON THE WEB</p>
        </div>
        </div>
        <div class="icons">
            <img src="/lab-assets/fb-icon.png" />
            <img src="lab-assets/twit-icon.png" />
            <img src="lab-assets/gp-icon.png" />
            <img src="lab-assets/insta-icon.png" />
            <img src="/lab-assets/flic-icon.png" />
            <img src="lab-assets/pint-icon.png" />
            <img src="/lab-assets/rss-icon.png" />
            <img src="/lab-assets/mail-icon.png" />
        </div>
      </header>
    )}

export default App;
